import React from 'react';
import Row from './Row';


class Game extends React.Component{

  spawnrow() {
    var tabr = [];
    for (var i = 0; i < 10; i++) {
      tabr.push(<Row key={i} aorb="A"></Row>)
    }
    return tabr;
  }

  spawnrowb() {
    var tabrb = [];
    for (var i = 0; i < 10; i++) {
      tabrb.push(<Row key={i} aorb="B"></Row>)
    }
    return tabrb;
  }

  render() {
    return (
      <div className="main">
      <div className="bg:color:lime:5 pmain1">
      {
        this.spawnrow.bind(this)()
      }
      </div>
      <div className="bg:color:yellow:5 pmain2">
      {
        this.spawnrowb.bind(this)()
      }
      </div>
      </div>
    );
  }
}


export default Game;
